class File extends Component {
  method(name2) {
    return <span>{name2}</span>;
  }

  render() {
    const name = "Rami";
    const name2 = this.method("Kuteish");
    return (
      <h1>
        {name}

        {name2}
      </h1>
    );
  }
}
export default File;
